import React from "react";

const Footer = () => {
  return (
    <footer style={styles.footer}>
      <div style={styles.footerTop}>
        <div style={styles.aboutSection}>
          <h3 style={styles.logo}>Artizal</h3>
          <p style={styles.aboutText}>
            The first Moroccan platform linking manufacturers and craftsmen with marketers worldwide, streamlining the e-commerce process to empower local products and provide exceptional customer experiences.
          </p>
          <p style={styles.contact}>
            Got Questions? Call us 24/7 <br />
            <strong>(+212) 06 62 62 53 83</strong>
          </p>
        </div>

        <div style={styles.linksSection}>
          <h4 style={styles.sectionTitle}>Useful Links</h4>
          <ul style={styles.linksList}>
            <li><a href="#" style={styles.link}>Home</a></li>
            <li><a href="#" style={styles.link}>About</a></li>
            <li><a href="#" style={styles.link}>Brand & Drop</a></li>
            <li><a href="#" style={styles.link}>Sell on Artizal</a></li>
            <li><a href="#" style={styles.link}>Contact</a></li>
            <li><a href="#" style={styles.link}>FAQ</a></li>
          </ul>
        </div>

        <div style={styles.registerSection}>
          <h4 style={styles.sectionTitle}>Register</h4>
          <p style={styles.registerText}>
            What are you waiting for to start your e-commerce journey?
          </p>
          <button style={styles.registerButton}>Sell on Artizal</button>
          <div style={styles.socialIcons}>
            <a href="#" style={styles.icon}>🌐</a>
            <a href="#" style={styles.icon}>📘</a>
            <a href="#" style={styles.icon}>📸</a>
            <a href="#" style={styles.icon}>🎥</a>
          </div>
        </div>
      </div>
      <div style={styles.footerBottom}>
        <p>© 2025 Artizal. All Rights Reserved.</p>
      </div>
    </footer>
  );
};

const styles = {
  footer: {
    backgroundColor: "#1a1a1a",
    color: "white",
    fontFamily: "'Arial', sans-serif",
  },
  footerTop: {
    display: "flex",
    justifyContent: "space-between",
    flexWrap: "wrap",
    padding: "2rem",
  },
  aboutSection: {
    flex: "1 1 300px",
    marginBottom: "1.5rem",
  },
  logo: {
    fontSize: "1.8rem",
    fontWeight: "bold",
    color: "#ffbf47",
    marginBottom: "1rem",
  },
  aboutText: {
    fontSize: "1rem",
    lineHeight: "1.6",
    marginBottom: "1rem",
  },
  contact: {
    fontSize: "1rem",
    lineHeight: "1.5",
  },
  linksSection: {
    flex: "1 1 200px",
    marginBottom: "1.5rem",
  },
  sectionTitle: {
    fontSize: "1.2rem",
    fontWeight: "bold",
    marginBottom: "1rem",
  },
  linksList: {
    listStyle: "none",
    padding: 0,
    margin: 0,
  },
  link: {
    color: "white",
    textDecoration: "none",
    display: "block",
    marginBottom: "0.5rem",
    transition: "color 0.3s",
  },
  registerSection: {
    flex: "1 1 200px",
    marginBottom: "1.5rem",
  },
  registerText: {
    fontSize: "1rem",
    marginBottom: "1rem",
  },
  registerButton: {
    padding: "0.5rem 1rem",
    backgroundColor: "#ffbf47",
    color: "#1a1a1a",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    fontWeight: "bold",
  },
  socialIcons: {
    marginTop: "1rem",
    display: "flex",
    gap: "1rem",
  },
  icon: {
    fontSize: "1.5rem",
    color: "#ffbf47",
    textDecoration: "none",
    transition: "color 0.3s",
  },
  footerBottom: {
    textAlign: "center",
    padding: "1rem",
    borderTop: "1px solid #333",
    fontSize: "0.9rem",
  },
};

export default Footer;
